// TryBeanhub.js
import React from 'react';
import '../../App.css';
import Chatbot from '../Chatbot';
import Footer from '../Footer';
import Order from '../Order';

function TryBeanhub() {
  return (
    <>
      <h1 className='trybeanhub'>TRY BEANHUB</h1>
      <Order />
      <Chatbot />
      <Footer />
    </>
  );
}

export default TryBeanhub;
